import React, { Component } from 'react';
import './App.css';

function Stream(props) {
    return (
      <a href = { props.url } target = "_blank">
        <img src = { props.thumbnail }></img>
        <h1>{ props.displayName }</h1>
        <div>{ props.title }</div>
        <p>{ props.viewers }</p>
      </a>
    );
}
